// Get the global workflow static data
const staticData = getWorkflowStaticData('global')

// Access its data
const lastStarRssId = staticData.lastStarRssId

let list = []

for (const item of items[0].json.content){
  let currentId = item.id
  if(currentId == lastStarRssId) break;
  list.push({'json':{
    'id': currentId,
    'lastId': lastStarRssId,
    'url': item.link,
    'tags': item.tags,
    'access_token': items[1].json.access_token
  }})
}


// Get the last ID from Rss Feed
let currentStarRssId = items[0].json.content[0].id

// TODO: make a loop to get all the items beyond the last saved id
if(!lastStarRssId || currentStarRssId != lastStarRssId)
{  
  // Update its data
  staticData.lastStarRssId = currentStarRssId;

}
else { list = [{'json':{ 'id': 'Nan', 'lastId': staticData.lastStarRssId }}] }
return list;

